                <div className="card docs"> 
                    <h2>Hello! Welcome to Math Calculations by Simmus</h2>
                    <h5>Select the feature you wanna use in the left side of your screen, enjoy!</h5>
                </div>
            </div>
            </div>
            
            
        
        );
    } 
}
